de":"if (!window._bt_scale_range) {\n    window._bt_scale_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1296835","type":"CustomJS"},{"attributes":{"data":{"Close":{"__ndarray__":"hqsDIO7q0z+zQSYZOQvVPyTyXUpdMtc/V+4FZoUi1j9ok8MnnUjXP55A2ClWDdk/JnFWRE303D9AFqJD4EjaP3vXoC+9/dk/gNb8+EuL2j98taM4Rx3YPy/gZYaNstY/M4l6wac52D9TeqaXGMvbPykIHt/eNd0/NsgkI2dh2z9Q4978honbPzDw3Hu4ZOA/9n6jHTf84j8F3smnx7bgPxCWsaGbfeA/DY6SV+eY4D8dHOxNDEniP8JLcOoDSeE/RzmYTYDh4D/SjbCoiNPfP38yxofZy94/NgLxun7B4D/4/ZsXJ77gP/DfvDjxVeE/Gk0uxsA64D+hD5axoZviPwr19BH4Q+E/p+fdWFAY4z9IMxZNZyfkPy+H3XcMD+A/QbrYtFII4j/dJ0cBomDiPwfOGVHam+M/W2CPiZTm5D+0keumlFflPz9wlScQduM/NzRlpx9U5T8vxOqPMIzlP9ds5SX/k+g/9s5oq5JI5j/mlettMxXkP8xgjEgUWuI/deWzPA/u4z+R7Xw/NV7iPwt9sIwN3eE/d/S/XIsW4T9bXU4JiEneP13Cobd4+OA/cqd0sP7P3z8WTWcngyPgP4/C9ShcD+A/Xyf1ZWkn4D/OpiOAm0XiP8Lc7uU+OeE/LV4sDJHT4T+4A3XKo5vhP9h
